            const float weight_4[4][10] = {{0.21194049716, -0.580137789249, 0.477200597525, 0.546516537666, 0.289287656546, -0.139059305191, 0.107126109302, -0.268500477076, 0.575819969177, -0.0140929380432}, 
                {0.758328974247, 0.463262975216, -0.768998205662, -0.461077779531, -0.537619411945, -0.00966831669211, -0.0221976283938, 0.424261897802, -0.934766173363, -0.135867238045}, 
                {-0.576311409473, 0.346277028322, 0.228969171643, -0.293184280396, -0.228002905846, -0.749263763428, -0.374391287565, 0.194627657533, 0.239471778274, 0.662560522556}, 
                {-0.191674098372, 0.459126055241, 0.839051604271, -0.128845125437, -0.341660231352, -0.0362818203866, 0.468450039625, -0.354960292578, -0.365595668554, -0.161059424281}}; 
            const double bias_4[4] = {-0.13391700387, 0.0872709155083, -0.088907495141, 0.12807957828}; 
            const double var_means[12] = {166.293861524, 1.97129685529, 0.990818719592, 76.0101191884, 2.33902377241, 103.247771607, 58.4212908441, 147.292314791, 76.730371924, 2.80036597601, 243.295312927, -0.579771070374};
            const double var_std[12] = {184.18373209, 0.869629628423, 0.762168674958, 54.7136326292, 0.856654928235, 102.90862159, 62.0118527295, 109.57573036, 56.5160694311, 0.393888277392, 159.158144129, 0.538405811917};

            float mll_var{*mll->Get()};
            float dphill_var{*dphill->Get()};
            float detall_var{*detall->Get()};
            float ptll_var{*ptll->Get()};
            float drll_var{*drll->Get()};
            float pt1_var = Lepton_pt->At(0);
            float pt2_var = Lepton_pt->At(1);
            int jet1_idx = CleanJet_jetIdx->At(0);
            float jet1_btag = Jet_btagDeepFlavB->At(jet1_idx);
            float jet1_pt = CleanJet_pt->At(0);
